import React from 'react';
import './App.css';
import MainMenu from './Components/MainMenu';
import HeroCarousel from './Components/HeroCarousel';
import BannerAd from './Components/BannerAd';

function App() {
  return (
    <div className="container-web ">
    <MainMenu/>
    <HeroCarousel/>
    <BannerAd/>
    </div>
  );
}

export default App;
